import React from 'react'
import { Container, Col, Row } from 'reactstrap';
import Delete from "./Layout/Delete";
import EditAct from "./Action/EditAct";

const DeleteAct = ({ value, label, photo }) => {
    return (
        <Container>
            <Row>
                <EditAct buttonLabel="Edit" label={label} photo={photo} value={value} />
                <Col>
                    <Delete buttonLabel="Hapus" className={"modalHapus"} />
                </Col>
            </Row>
        </Container>
    );
};

export default DeleteAct;
